const TOPIX_STATUS = {
  EXCLUDED: '除外',
  CONTINUED: '継続',
  NEW: '新規'
};

const TOPIX_MARKETS = {
  PRIME: 'プライム',
  STANDARD: 'スタンダード',
  GROWTH: 'グロース'
};

function getTopixStockByCode(code) {
  return TOPIX_DATA.find(stock => stock.code === code);
}

function filterTopixByStatus(status) {
  return TOPIX_DATA.filter(stock => stock.status === status);
}

function filterTopixByMarket(market) {
  return TOPIX_DATA.filter(stock => stock.market.includes(market));
}

function getTopixStats() {
  const stats = {
    total: TOPIX_DATA.length,
    excluded: 0,
    continued: 0,
    new: 0,
    prime: 0,
    standard: 0,
    growth: 0
  };

  TOPIX_DATA.forEach(stock => {
    if (stock.status === TOPIX_STATUS.EXCLUDED) stats.excluded++;
    if (stock.status === TOPIX_STATUS.CONTINUED) stats.continued++;
    if (stock.status === TOPIX_STATUS.NEW) stats.new++;

    if (stock.market.includes(TOPIX_MARKETS.PRIME)) stats.prime++;
    if (stock.market.includes(TOPIX_MARKETS.STANDARD)) stats.standard++;
    if (stock.market.includes(TOPIX_MARKETS.GROWTH)) stats.growth++;
  });

  return stats;
}
